<H1><A NAME="prf1522"></A><SUP></SUP>Profiler Error PRF1522</H1>

<P class=dt><B>fatal error -- PREP I -- more than one function matched entry specification: funcname1 and funcname2</B></P>

<P>Function profiling only: there were two or more functions with matching names. Perhaps these are C++ overloaded functions. Use decorated names to specify the functions.</P>
